from collections import defaultdict
import functools
import heapq
from queue import Queue,LifoQueue,PriorityQueue
from bisect import bisect_right,insort_left,bisect_left

class Solution(object):
    def getOrder(self, tasks):
        """
        :type tasks: List[List[int]]
        :rtype: List[int]
        """
        hp =[]
        for i,t in enumerate(tasks):
            #print(i,t)
            heapq.heappush(hp,(t[0],t[1],i,t))
        idx = 0
        res =[]
        cnt = 0
        hp2=[]
        while hp:
            t = heapq.heappop(hp)
            cnt +=1
            # if cnt >19999:
            #     print(res,idx)
            #     return
            # print(t,idx)

            if t[0] >=idx:
                res.append(t[2])
                idx = max(idx + t[1], t[0] + t[1])
                #print(idx,res)
            else:
                t0,t1,t2,t3 = t
                heapq.heappush(hp2,(t1,t2,t3))
                while hp and  hp[0][0] <=idx:
                    t = heapq.heappop(hp)
                    t0,t1,t2,t3 = t
                    heapq.heappush(hp2,(t1,t2,t3))
                #print(hp2)

                t =heapq.heappop(hp2)
                res.append(t[1])
                idx += t[0]
        while hp2:
            t =heapq.heappop(hp2)
            res.append(t[1])
            idx += t[0]
                
        #print(res)
        return res

